package expression.generic;public class GenericMax<T> extends GenericOperation<T> {    public GenericMax(GenericGeneralExpression<T> first, GenericGeneralExpression<T> second, NumberMode<T> calculator) {        super.first = first;        super.second = second;        super.sign = " max ";        super.calculator = calculator;    }    public T operation(T first, T second) {        return calculator.max(first, second);    }}